# El usuario debe ingresar dos variables
# mu : representar la media de una distribucion normal 
# std : representar la desviacion estandar de una dist. normal 
# Generar 200000 elementos con esos parametros y contar
# cuantos de esos elementos son mayores a mu+3*std

mu = float(input("Ingresemos la media : "))
std = float(input("Ingresemos sigma "))

ListaR1 = []
for i in range(200000):
  ListaR1.append(rnd.gauss(mu, std))

print("Num. de elementos de ListaR1 ", len(ListaR1))

# Usaremos una estructura repetitiva sobre todos los elementos
# de ListaR1
NumElementos = 0
for elem in ListaR1:
  if elem> mu+3*std:
    NumElementos = NumElementos+1

print("""
El numero de elementos mayores a %f es %d
""" %(mu+3*std, NumElementos))

