# Implementemos la idea explicada en pizarra
f = lambda x:x**2 -x-1

a = float(input("Ingrese el extremo inferior del intervalo de busqueda :"))
b = float(input("Ingrese el extremo superior del intervalo de busqueda :"))

if f(a)*f(b)>= 0:
  print("LOs valores ingresados son inadecuados")
  print("Estudie el TVM")
else:
  a_n = a 
  b_n = b
  for n in range(1,100+1):
    m_n = (a_n + b_n)/2
    f_m_n = f(m_n)
    if f(a_n)* f_m_n < 0:
      a_n = a_n
      b_n = m_n
    elif f(b_n)*f_m_n<0:
      a_n = m_n
      b_n = b_n
    elif f_m_n == 0:
      print("Solucion exacta ", m_n)
      break
    else:
      print("El metodo explicado en clase falla")